INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/01/31 12:00:00", "2030/01/01 14:59:59", 133701, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, 10201, "ラビリスタ", 61, 1020101, 5.18, -6.0, 7, -285.0, 3);
