INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/03/31 12:00:00", "2030/01/01 14:59:59", 134601, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, 10203, "アオイ", 61, 1020301, 8.595, 0.0, 2, -285.0, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/03/31 12:00:00", "2030/01/01 14:59:59", 134501, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, 10203, "クローチェ", 61, 1020302, 7.758, 0.0, 2, -285.0, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/04/30 12:00:00", "2030/01/01 14:59:59", 132302, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, 10204, "ルイズマリー", 61, 1020401, 7.0, 0.0, 6, -285.0, 2);
